(15, 681, '2024-09-12 13:00:00', 'Vysvětlil jsem náš program. Čekám na návrhy obsahu WS. Viděl jsem výrobní linku'),
(16, 684, '2024-10-02 19:23:00', '\nuž k nim chodí 9 žáků z jiné školy 2d jednou za 14 dní\nKomponenty pro bezpilotní letadla - palubní počíta, pohon, navigace, vysílačka\n'),
(17, 264, '2024-09-30 13:15:00', 'školení pro učitele a to proškolí. Pak certifikují vyučující.\nK existujímu stroji je schopen dodat virtuální dvojče ke stroji.\nPřipravují vzděl. obsah pro učitel\nRošíření studia...\nProgramování CNC strojů\ndemoverze strojů - sw, 95% sleva \nPlatí si učitel z VŠ dělá zajimavé\nMohou to učit i fyzikáři - kinematik. hm. bodu.\nSinumeric CUP\nPosalt naše TP. \nProdiskutovat, jak to napojit na výuku.\nDo 14.10. si říct, co bude.\n');
